import data from "../mock-data.json";
import { Nav } from "./Nav";

export const ExerciseTable = () => {
  const rows = data[0].exercises.map((row) => {
    return Object.values(row);
  });
  const columns = ["Exercise Names", "Reps", "Sets"];

  return (
    <div>
      <Nav />
      <Table columns={columns} rows={rows} />;
    </div>
  );
};
